import React from 'react';
import Header from '../components/Header';

class Search extends React.Component {
  render() {
    return (
      <div data-testid="page-search">

        <Header />
        <h1>search</h1>
        <label htmlFor="artistInput">
          <input data-testid="search-artist-input" type="text" name="artistInput" onChange={ this.handleChageInput } />
        </label>
        <input data-testid="search-artist-button" type="button" value="Pesquisar" />
      </div>);
  }
}
export default Search;
